import './index.scss';
import LogoM from '../../../assets/images/logo-m.png'
import { useRef, version } from 'react';

const Logo = () => {
    const bgRef = useRef();
    const outlineLogoRef = useRef();
    const solidLogoRef = useRef();
    return (
        <div className='logo-container'>
            <img className="solid-logo" src={LogoM} alt="M"/>
            <svg
                width="559pt"
                height="897pt"
                version="1.0"
                viewBox="0 0 559 897"
                xmlns="https://www.w3.org/2000/svg"
            >
                <g
                    className="svg-container"
                    transform="translate(0 457) scale(.1 0.1"
                    fill="none"
                >
                    <path d="m2930"/>
                </g>

            </svg>

        </div>
    )
}

export default Logo
